// SPDX-License-Identifier: MIT

pragma solidity ^0.8.7; //for supported version

import "./DataStorageContract.sol";

contract DataStorageHub {

    mapping (string => DataStorageContract) public DataStorageMap;

   function createNewContract( string memory _name) public {

       DataStorageContract DataStorageContractInstance;
       DataStorageMap[_name]= DataStorageContractInstance;

   }

}

contracts/composedContract/DataStorageCo.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.7; //for supported version

contract DataStorageContract{

    string unique_id;
    bool status;

    mapping (string => bool)  DataMap;

    function getStatus(string memory _uniqueId) public view returns (bool) {
        return DataMap[_uniqueId];
    }

     function setStatus(string memory _uniqueId , bool _status) public {
         DataMap[_uniqueId]=_status;

    }
}

